import React from "react";

const GradCAMVisualization = ({ gradcam }) => {
  return (
    <div className="mt-4">
      <h3 className="text-lg font-semibold mb-2">Grad-CAM Visualization</h3>
      <div className="border rounded p-2 flex justify-center items-center">
        {gradcam ? (
          <img
            src={`data:image/png;base64,${gradcam}`}
            alt="Grad-CAM heatmap highlighting key areas of interest in the image."
            className="w-full h-auto rounded object-contain"
          />
        ) : (
          <p className="text-gray-500 text-sm">No Grad-CAM visualization available.</p>
        )}
      </div>
    </div>
  );
};

export default GradCAMVisualization;
